import { useParams } from "react-router";
import { instanceAxs } from "../../api/Api";

function ProductPage() {
    let {id} = useParams();

    const [users, setUsers] = use

    const findAnnonce = () => {
        instanceAxs.get('/users')
            .then(respond => {
                console.log(respond);
                setUsers(respond.data.users)
            })
    }

    return(
        <div>
            <p>product page</p>
            <p>{id}</p>
        </div>
    )
}

export default ProductPage;
